import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    return (
        <div className='tc'>
            {
                robots.map((user, i) => {
                    return (
                        <Card
                        key={i} 
                        // id={robots[i].id} 
                        name={robots[i].name} 
                        email={robots[i].email}
                        />
                    );
                }).sort((a,b) => a.name > b.name ? 1 : -1)
            }
        </div>
    )
}

export default CardList;
